import React from 'react';
import Header from './components/Header';
import Home from './components/Home';
import CharactersNav from './components/CharactersNav';
import CharacterInfo from './components/CharacterInfo';
import EpisodesNav from './components/EpisodesNav';
import EpisodeInfo from './components/EpisodeInfo';
import QuotesNav from './components/QuotesNav';
import QuoteInfo from './components/QuoteInfo';
import Footer from './components/Footer';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
// import { Link, Route } from 'react-router-dom';
import './App.css';

function App() {
	return (
		<Router>
			<div className='App'>
				<Header />
				<Switch>
					<Route exact path='/' component={Home} />
					<Route exact
 exact path='/characters' component={CharactersNav} />
					<Route exact
 exact path='/characters/:characterId' component={CharacterInfo} />
					<Route exact
 exact path='/episodes' component={EpisodesNav} />
					<Route exact
 exact path='/episodes/:episodeId' component={EpisodeInfo} />
					<Route exact
 exact path='/quotes' component={QuotesNav} />
					<Route exact
 exact path='/quotes/:quoteId' component={QuoteInfo} />
				</Switch>
				<Footer />
			</div>
		</Router>
	);
}

export default App;
